    true,nt"url": null,nt"notes": "The Civil Reserve Air Fleet is a cooperative,
    voluntary program involving the DOT, DOD and the U.S. civil air carrier industry
    in a partnership to augment DOD aircraft capability during a national defense related
    crisis. Air carriers volunteer their aircraft to the CRAF program through contractual
    agreements with the air mobility command (AMC), located at Scott Air Force Base,
    Illinois.  In return, the participating carriers are given preference in carrying
    commercial peacetime cargo and passenger traffic for DOD.",nt"license_title":
